const App = () => {
  const catagories = [
    {
      id: 1,
      title: "Hats"
    },
    {
      id: 2,
      title: "Jacket"
    },
    {
      id: 3,
      title: "sneakers"
    },
    {
      id: 4,
      title: "womans"
    },
    {
      id: 5,
      title: "mens"
    }

  ]

  return (
    catagories.map(({ title }) => (
      <div>
        <h1>{title}</h1>
        <p>Shop Now</p>
      </div>
    ))

  );
}

export default App;
